read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New) when element(1, Prev) =:= element(1, New) -> merge_msgs(Prev, New, element(1, Prev), []).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) -> merge_msgs(Prev, New, MsgName, []);
merge_msgs(Prev, New, Opts) when element(1, Prev) =:= element(1, New), is_list(Opts) -> merge_msgs(Prev, New, element(1, Prev), Opts).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'Message' -> merge_msg_Message(Prev, New, TrUserData);
        'RouteRequest' -> merge_msg_RouteRequest(Prev, New, TrUserData);
        'RouteDecision' -> merge_msg_RouteDecision(Prev, New, TrUserData);
        'UpsertPolicyRequest' -> merge_msg_UpsertPolicyRequest(Prev, New, TrUserData);
        'UpsertPolicyResponse' -> merge_msg_UpsertPolicyResponse(Prev, New, TrUserData);
        'DeletePolicyRequest' -> merge_msg_DeletePolicyRequest(Prev, New, TrUserData);
        'DeletePolicyResponse' -> merge_msg_DeletePolicyResponse(Prev, New, TrUserData);
        'GetPolicyRequest' -> merge_msg_GetPolicyRequest(Prev, New, TrUserData);
        'GetPolicyResponse' -> merge_msg_GetPolicyResponse(Prev, New, TrUserData);
        'ListPoliciesRequest' -> merge_msg_ListPoliciesRequest(Prev, New, TrUserData);
        'ListPoliciesResponse' -> merge_msg_ListPoliciesResponse(Prev, New, TrUserData);
        'AdminPolicy' -> merge_msg_AdminPolicy(Prev, New, TrUserData);
        'AdminProvider' -> merge_msg_AdminProvider(Prev, New, TrUserData);
        'AdminRule' -> merge_msg_AdminRule(Prev, New, TrUserData);
        'GetCheckpointStatusRequest' -> merge_msg_GetCheckpointStatusRequest(Prev, New, TrUserData);
        'CheckpointStatus' -> merge_msg_CheckpointStatus(Prev, New, TrUserData);
        'GetCheckpointStatusResponse' -> merge_msg_GetCheckpointStatusResponse(Prev, New, TrUserData);
        'GetValidatorsHealthRequest' -> merge_msg_GetValidatorsHealthRequest(Prev, New, TrUserData);
        'ValidatorStatus' -> merge_msg_ValidatorStatus(Prev, New, TrUserData);
        'GetValidatorsHealthResponse' -> merge_msg_GetValidatorsHealthResponse(Prev, New, TrUserData)
    end.


merge_msg_Message(#'Message'{message_id = PFmessage_id, tenant_id = PFtenant_id, trace_id = PFtrace_id, message_type = PFmessage_type, payload = PFpayload, metadata = PFmetadata, timestamp_ms = PFtimestamp_ms},
                  #'Message'{message_id = NFmessage_id, tenant_id = NFtenant_id, trace_id = NFtrace_id, message_type = NFmessage_type, payload = NFpayload, metadata = NFmetadata, timestamp_ms = NFtimestamp_ms}, TrUserData) ->
    #'Message'{message_id =
                   if NFmessage_id =:= undefined -> PFmessage_id;
                      true -> NFmessage_id
                   end,
               tenant_id =
                   if NFtenant_id =:= undefined -> PFtenant_id;
                      true -> NFtenant_id
                   end,
               trace_id =
                   if NFtrace_id =:= undefined -> PFtrace_id;
                      true -> NFtrace_id
                   end,
               message_type =
                   if NFmessage_type =:= undefined -> PFmessage_type;
                      true -> NFmessage_type
                   end,
               payload =
                   if NFpayload =:= undefined -> PFpayload;
                      true -> NFpayload
                   end,
               metadata =
                   if PFmetadata /= undefined, NFmetadata /= undefined -> 'tr_merge_Message.metadata'(PFmetadata, NFmetadata, TrUserData);
                      PFmetadata == undefined -> NFmetadata;
                      NFmetadata == undefined -> PFmetadata
                   end,
               timestamp_ms =
                   if NFtimestamp_ms =:= undefined -> PFtimestamp_ms;
                      true -> NFtimestamp_ms
                   end}.


merge_msg_RouteRequest(#'RouteRequest'{message = PFmessage, policy_id = PFpolicy_id, context = PFcontext}, #'RouteRequest'{message = NFmessage, policy_id = NFpolicy_id, context = NFcontext}, TrUserData) ->
    #'RouteRequest'{message =
                        if PFmessage /= undefined, NFmessage /= undefined -> merge_msg_Message(PFmessage, NFmessage, TrUserData);
                           PFmessage == undefined -> NFmessage;
                           NFmessage == undefined -> PFmessage
                        end,
                    policy_id =
                        if NFpolicy_id =:= undefined -> PFpolicy_id;
                           true -> NFpolicy_id
                        end,
                    context =
                        if PFcontext /= undefined, NFcontext /= undefined -> 'tr_merge_RouteRequest.context'(PFcontext, NFcontext, TrUserData);
                           PFcontext == undefined -> NFcontext;
                           NFcontext == undefined -> PFcontext
                        end}.


merge_msg_RouteDecision(#'RouteDecision'{provider_id = PFprovider_id, reason = PFreason, priority = PFpriority, expected_latency_ms = PFexpected_latency_ms, expected_cost = PFexpected_cost, metadata = PFmetadata},
                        #'RouteDecision'{provider_id = NFprovider_id, reason = NFreason, priority = NFpriority, expected_latency_ms = NFexpected_latency_ms, expected_cost = NFexpected_cost, metadata = NFmetadata}, TrUserData) ->
    #'RouteDecision'{provider_id =
                         if NFprovider_id =:= undefined -> PFprovider_id;
                            true -> NFprovider_id
                         end,
                     reason =
                         if NFreason =:= undefined -> PFreason;
                            true -> NFreason
                         end,
                     priority =
                         if NFpriority =:= undefined -> PFpriority;
                            true -> NFpriority
                         end,
                     expected_latency_ms =
                         if NFexpected_latency_ms =:= undefined -> PFexpected_latency_ms;
                            true -> NFexpected_latency_ms
                         end,
                     expected_cost =
                         if NFexpected_cost =:= undefined -> PFexpected_cost;
                            true -> NFexpected_cost
                         end,
                     metadata =
                         if PFmetadata /= undefined, NFmetadata /= undefined -> 'tr_merge_RouteDecision.metadata'(PFmetadata, NFmetadata, TrUserData);
                            PFmetadata == undefined -> NFmetadata;
                            NFmetadata == undefined -> PFmetadata
                         end}.


merge_msg_UpsertPolicyRequest(#'UpsertPolicyRequest'{tenant_id = PFtenant_id, policy = PFpolicy}, #'UpsertPolicyRequest'{tenant_id = NFtenant_id, policy = NFpolicy}, TrUserData) ->
    #'UpsertPolicyRequest'{tenant_id =
                               if NFtenant_id =:= undefined -> PFtenant_id;
                                  true -> NFtenant_id
                               end,
                           policy =
                               if PFpolicy /= undefined, NFpolicy /= undefined -> merge_msg_AdminPolicy(PFpolicy, NFpolicy, TrUserData);
                                  PFpolicy == undefined -> NFpolicy;
