'tr_encode_RouteDecision.metadata[x]'(X, _) -> mt_maptuple_to_pseudomsg_r(X, 'map<string,string>').

-compile({inline,'tr_decode_init_default_Message.metadata'/2}).
'tr_decode_init_default_Message.metadata'(_, _) -> mt_empty_map_r().

-compile({inline,'tr_merge_Message.metadata'/3}).
'tr_merge_Message.metadata'(X1, X2, _) -> mt_merge_maptuples_r(X1, X2).

-compile({inline,'tr_decode_repeated_finalize_Message.metadata'/2}).
'tr_decode_repeated_finalize_Message.metadata'(L, _) -> mt_finalize_items_r(L).

-compile({inline,'tr_decode_repeated_add_elem_Message.metadata'/3}).
'tr_decode_repeated_add_elem_Message.metadata'(Elem, L, _) -> mt_add_item_r(Elem, L).

